import "./EventItem.css";
import tennis from "../../assets/Images/tennis.jpg";

const EventItem = () => {
  return (
    <div id="layoutEvents">
      <div className="theImage">
        {" "}
        <img src={tennis} alt="aa" />
        here Image sport
      </div>
      <div id="eventBox">
        Sport : Beginner
        <div>Location</div>
        <div>Date</div>
        <div>Empty slots</div>
      </div>
    </div>
  );
};
{
  /* <div className="theOwner">Here owner and name</div> */
}

export default EventItem;
